import React, {useState, useEffect} from 'react';
import './Header.css'
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import { withStyles } from '@mui/styles';


import DigitalCreations from './DigitalCreations';
import EventPlanning from './EventPlanning';
import Photography from './Photography';
import WritingSample from './WritingSample'

const Header = () => { 
    const [value, setValue] = React.useState('1');

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };

    const styles = theme => ({
        indicator: {
          backgroundColor: 'white',
          color: '#71CECE'
        },
      })

    // const CustomTab = withStyles({
    //     root: {
    //       backgroundColor: 'transparent',
    //       color: '#71CECE'
    //     },
    //     selector: {
    //       backgroundColor: 'transparent',
    //       color: '#71CECE'
    //     },
    //   })(Tab);

    return (
    <div>
        <div className="header">
            <h1>
            Meghan Levinson
            </h1>
            <div className="subHeader">
                Digital Marketer & Content Creator 
            </div>
        </div>
        <div className="tab">
        <Box sx={{ width: '100%' }} >
        <TabContext value={value} >
            <TabList onChange={handleChange} aria-label="lab API tabs example">
                <Tab label="Writing Sample" value="1" style={{ color: '#71CECE', active: '#71CECE' }} />
                <Tab label="Event Planning" value="2"  style={{ color: '#71CECE' }} />
                <Tab label="Digital Creations" value="3" style={{ color: '#71CECE' }}  />
                <Tab label="Photography" value="4" style={{ color: '#71CECE' }} />
            </TabList>
        </TabContext>
        </Box>
        </div>
    </div>
)
}
export default Header
